&lt;p&gt;
	Eagle is the CAD package I use for my schematics and pcbs. Their libraries are probably the most comprehensive of all the free packages out there, but sometimes there are part layouts I need that aren&#039;t available.&amp;nbsp;&lt;/p&gt;
&lt;p&gt;
	This library contains parts that I have used in my projects. Most of them are rather specific and obscure components (like the MBI5026), but i&#039;m going to post it anyway because it might save someone else time.&amp;nbsp;&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp;&lt;/p&gt;
